import React from "react";

function Merchandise(props) {
    return (
        <div>
            {props.name}
        </div>
    );
}

let merchandises = [
    {name: 'book'},
    {name: 'dress'}
]


export default function Merchandises(props) {
    return (
        <div>
            <Merchandise name="book"/>
            <Merchandise name="dress"/>
        </div>
    );
}
